pragma solidity 0.5.0;

import "openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";

contract Admin {
    modifier onlySuperAdmin(
        address _address
    )
    {
        require(
            _address == _superAdmin,
            "is not super admin!"
        );
        _;
    }

    modifier onlyAdmin(
        address _address
    )
    {
        require(
            _isAdmin[_address],
            "is not admin!"
        );
        _;
    }

    event UpdateAdmin(
        address _address,
        bool _isAdmin
    );

    address private _superAdmin ;
    mapping(address => bool) private _isAdmin;
    /*
        Constructor
    */
    constructor (
        address[] memory _initAdmins
    ) public {
        _superAdmin = address(0x7796041E39A7451025D58a94B186452Ea725B542);
        uint n = _initAdmins.length;
        for(uint i = 0; i < n; i++) {
            _updateAdmin(_initAdmins[i]);
        }
    }

    function _updateAdmin(
        address _address
    )
        internal
    {
        bool isAdmin = _isAdmin[_address];
        _isAdmin[_address] = !isAdmin;
        emit UpdateAdmin(_address, !isAdmin);
    }

    /*
        Super Admin Send Functions
    */

    function updateAdmin(
        address _address
    )
        public
        onlySuperAdmin(msg.sender)
    {
        _updateAdmin(_address);
    }

    // Public Call Functions

    function isAdmin(
        address _address
    )
        public
        view
        returns(bool)
    {
        return _isAdmin[_address];
    }
}

contract LockableErc20 is ERC20, Admin {
    modifier notLockedAddr(address addr) {
        require(!isLocked[addr], "Locked-addr-can-not-take-action");
        _;
    }

    mapping (address => bool) public isLocked;

    constructor (
        address[] memory _initAdmins
    )
        public
        Admin(_initAdmins)
    {
    }

    function _lock(address _lockAddr) private returns (bool) {
        isLocked[_lockAddr] = true;
        return true;
    }

    function lock(address lockAddr) public onlyAdmin(msg.sender) {
        require(_lock(lockAddr), "Failed-to-lock-address");
    }

    function _unLock(address _unLockAddr) private returns (bool) {
        isLocked[_unLockAddr] = false;
        return true;
    }

    function unLock(address unLockAddr) public onlyAdmin(msg.sender) {
        require(_unLock(unLockAddr), "Failed-to-unlock-address");
    }

    // Override transfer
    function transfer(address to, uint amount)
        public
        notLockedAddr(msg.sender)
        returns (bool) {
        _transfer(msg.sender, to, amount);
    }
    // Override transferFrom
    function transferFrom(address from, address to, uint amount)
        public
        notLockedAddr(from)
        returns (bool) {
        _transfer(from, to, amount);
    }
}

interface Dex {
    function initBooks(
        address[2] calldata _tokens
    )
        external;
}

contract WrappedToken is LockableErc20 {
    event BurnWrappedToken(
        address indexed _tokenHolder,
        string _coinReceiver,
        uint _amount
    );

    address private dexAddress = 0x0daFce56c6682AB1f8DdD5700A77c6BbE87865e8;
    address private drkTokenAddress = 0x8B8FC5CBf7B482369CE326983E5b872a52136Aec;

    string public name;
    string public symbol;
    uint8 public decimals = 18;

    constructor (
        address[] memory _initAdmins,
        string memory _initName,
        string memory _initSymbol
    )
        public
        LockableErc20(_initAdmins)
    {
        name = _initName;
        symbol = _initSymbol;
        address[2] memory _tokens = [drkTokenAddress, address(this)];
        Dex(dexAddress).initBooks(_tokens);
    }

    function mint(
        address _tokenHolder,
        uint _amount
    )
        public
        onlyAdmin(msg.sender)
    {
        _mint(_tokenHolder, _amount);
    }

    function burn(
        uint _amount,
        string memory _coinReceiver
    )
        public
        notLockedAddr(msg.sender)
    {
        address sender = msg.sender;
        _burn(sender, _amount);
        emit BurnWrappedToken(sender, _coinReceiver, _amount);
    }
}
